[[INCLUDES]]


-- Project 64 1.6

-- &quot;The Legend of Zelda: Ocarina of Time&quot; &amp; &quot;The Legend of Zelda: Majora's Mask&quot;            

   ROMs

-- Glide64 Graphics Plugin (Pre-Installed)

-- HD re-textures for both ROMs (Pre-Installed)


[[GRAPHICS SETTINGS]]


-- Open Project64

-- Goto &quot;Options&quot; on the menu bar and choose &quot;Configure Graphics Plugin...&quot;

-- A window titled &quot;Glide64 Settings&quot; should pop-up, If not, goto &quot;Options&quot; -- 

   &quot;Settings...&quot; -- and where it says &quot;Video (graphics plugin):&quot; click the drop

   down menu below it and choose &quot;Glide64 'Final' Date: Dec 29 2011&quot; then click the 

   OK button.

-- Go to the &quot;Texture enhancement&quot; tab in the &quot;Glide64 Settings&quot; window and make  

   sure the &quot;Use alpha channel fully&quot; box , both &quot;Compress texture cache&quot; boxes and 

   the &quot;Save texture cache to hard disk&quot; box are checked, and that all other boxes 

   in that tab are unchecked. Also, make sure that the &quot;Format&quot; drop down menu is 

   set to &quot;Rice Format&quot;





